import { useSelector } from "react-redux";

const GetPosts = () => {
  const user = useSelector((state) => state.profileUser);
  console.log(user.Posts.id);
  return (
    <>
      {profile.Posts && profile.Posts.length > 0 ? (
        user.Posts.map((us) => {
          return (
            <>
              <h1>{us.id}</h1>;<h1>{us.comment}</h1>;
            </>
          );
        })
      ) : (
        <p>Cargando...</p>
      )}
    </>
  );
};

export default GetPosts;
